Carla Cox makes another appearance this time with American traveler and general all-round cool guy, Dane Cross. The reason we brought this young pair together was that many years ago, while traveling around Europe Dane met Carla by pure chance, they had never met before but recognized each other from their adult work, since Carla has spent some time working in the US. Sparks flew, passion was ignited and they had a fling in real-life, so we thought it would be exciting to bring them together again, this time to capture the chemistry on-camera and present it for you!

We love real, natural passion and we let the guys make love together without any perimeters, they were free to explore and make each other very happy indeed!

